import { Project } from "./Project";

interface ProjectListProps {
    projects: Project[];
}

function ProjectList(props: ProjectListProps){
    return(
        <pre>
        {JSON.stringify(props.projects, null, ' ')}
        </pre>
    );

}

export default ProjectList;
